import React from 'react'


function Salaries(props){
  return(
    <li>
      <h2 id="name">{props.jobName}</h2>
      <p><span className="pct">25th Percentile:</span> ${Math.round(props.jobSalary25)}</p>
      <p><span className="pct">50th Percentile:</span> ${Math.round(props.jobSalary50)}</p>
      <p><span className="pct">75th percentile:</span> ${Math.round(props.jobSalary75)}</p>
    </li>
  )
}

export default Salaries;
